import { Needs } from './needs';

export const NEEDS: Needs[] = [
  { name: 'Rice', cost: 5, type: 'Dried', quantity: 50 },
  { name: 'Bread', cost: 1, type: 'Fresh', quantity: 40 },
  { name: 'Milk', cost: 2, type: 'Dairy', quantity: 20 },
  { name: 'Eggs', cost: 1, type: 'Dairy', quantity: 30 },
];
